export class AuthorizedPersonnel {
    // Basic Info
    fullName = '';
    email = '';
    phone = '';
    personalID = '';

    // Advanced Info
    rolName = '';
    rolType = '';
    code = '';

    constructor(fullName, email, phone, personalID, rolName, rolType, code) {
        this.fullName = fullName;
        this.email = email;
        this.phone = phone;
        this.personalID = personalID;
        this.rolName = rolName;
        this.rolType = rolType;
        this.code = code;
    }
}
